import "./ExpenseItem.css";

function ExpenseItem() {
  return (
    <div className="expense-item">
      <div> Jan. 2nd 2023</div>
      <div className="expense__description">
        <h1> Campus </h1>
      </div >
      <div className="expense-item__price">Pack.-450000/</div>
    </div>
  );
}

export default ExpenseItem;
